import React,{ useEffect, useState } from "react";
import {Link } from "react-router-dom";


function Menu()
{
    const imageObjectURL = ""
        
    async function load_pic() {
    
        const url1 = 'https://s3-ap-southeast-1.amazonaws.com/tksproduction/bmtimages/pY3BnhPQYpTxasKfx.jpeg';
    
        const options = {
            method: "GET"
        }
    
        let response = await fetch(url1, options)
    
        if (response.status === 200) {
            
            const imageBlob = await response.blob()
            imageObjectURL = URL.createObjectURL(imageBlob);
        }
        else {
            console.log("HTTP-Error: " + response.status)
        }
    }
        return(
            <div>
                <Link to='/'>Menu</Link>
                <Link to='/AccueilInscription'>AccuedddddddddddilInscription</Link>
                <Link to='/AccueilInscription'>component2</Link>  
                <img src={imageObjectURL}/>              
            </div> 
        
)}
export default Menu
